	@Override
	public String toString() {
		return "PolicyTerm [insured="
				+ (this.getInsured()!=null ? this.getInsured().toString() : null) + ", insurer=" +(this.getInsurer()!=null ? this.getInsurer().toString() : null) + ", producer=" + (this.getProducer()!=null ? this.getProducer().toString() : null)
				
				+ (this.getAdditionalPolicyDetail()!=null ? this.getAdditionalPolicyDetail().toString() : null) + ", cancellationInformation="
				+ (this.getCancellationInformation()!=null ? this.getCancellationInformation().toString() : null) + ", offeringInformation="
				+ ", policyPremium=" + (this.getPolicyPremium()!=null ? this.getPolicyPremium().toString() : null)
				+ ", controlNumber=" + this.getControlNumber() + ", policyNumber="
				+ this.getPolicyNumber() + ", policySICCode=" + this.getPolicySICCode()
				+ ", inceptionDate=" + this.getInceptionDate() + ", expirationDate="
				+ setDateFormat(this.getExpirationDate()) + ", originalInceptionDate="
				+ setDateFormat(this.originalInceptionDate) + ", originalExpirationDate="
				+ setDateFormat(this.originalExpirationDate) + ", doNotRenewInformation="
				+ this.getPolicyTermInMonths() + ", productionOfficeInformation="
				+ ", previousPolicyNumber=" + this.getPreviousPolicyNumber()
				+ ", insuranceAdminRole=" + this.getInsuranceAdminRole()
				+ ", underwriter=" + ((this.getUnderwriter()!= null) ? this.getUnderwriter().toString() : null) + ", underwriterAssistant="
				+ (this.getUnderwriterAssistant()!= null ? this.getUnderwriterAssistant().toString() : null)+ ", accountServiceRepresentative="
				+ "]";
	}
	
	private String setDateFormat(XMLGregorianCalendar date){
		
		if (date != null)
		{
		SimpleDateFormat sdf = new SimpleDateFormat("mm/dd/yyyy hh:mm:ss");
		GregorianCalendar gc = date.toGregorianCalendar();
		String formatted_date = sdf.format(gc.getTime());
		return formatted_date;
		}
		else
		{
			return null;
		}
	}

